import { Box, Text } from '@chakra-ui/react';
import React from 'react';

 const FileUploadList = ({ files }) => {
  return (
    <Box mt={4}>
      {files.length > 0 ? (
        files.map((file) => (
          <Text key={file.path}>{file.path}</Text>
        ))
      ) : (
        <Text>No files uploaded yet.</Text>
      )}
    </Box>
  );
};
export default FileUploadList;
